import React from 'react'
import DetailCard from '../components/pages/donate/DetailCard'


const Donate = ({ state, dispatch }) => {
    return (
        <div>
            <DetailCard state={state} dispatch={dispatch} />
           
        </div>

    )
}

export default Donate
